import react from 'react'
import web from '../src/images/webdev.jpg'
import app from '../src/images/appdev.jpg'
import software from '../src/images/software.jpg'
import digital from '../src/images/digital.jpg'
import android from '../src/images/computer.jpg'
import marketing from '../src/images/webdev1.jpg'


const Sdata = [
    {
        imgsrsc:web,
        title:'web development'
    },
    {
        imgsrsc:app,
        title:'app development'
    },
    {
        imgsrsc:software,
        title:'software development'
    },
    {
        imgsrsc:digital,
        title:'digital marketing'
    },
    {
        imgsrsc:android,
        title:'android development'
    },
    {
        imgsrsc:marketing,
        title:'marketing '
    }
]
export default Sdata;
